import React from 'react';

const Transaction = ({ date, vendor, amount, status, catagory }) => {
	return (
		<div>
			<div>
				<p className="fl w-20 tc">{date}</p> 
				<p className="fl w-20 tc">{vendor}</p> 
				<p className="fl w-20 tc">{amount}</p> 
				<p className="fl w-20 tc">{status}</p> 
				<p className="fl w-20 tc">{catagory}</p>
			</div>

		</div>
		);

}

export default Transaction;
